const containerStyle = {
    display: "flex",
    alignItem: "center",
    gap: "16px"
}

const starContainerStyle = {
    display: "flex",
    gap: "4px"
}
const StarRating = ({ maxStar = 5 }) => {
    return (
        <div style={containerStyle}>
            <div>{Array.from({ length: maxStar }, (_, i) => (
                <span>S{i + 1}</span>
            ))}</div>
            <p>10</p>
        </div>
    )
}

export default StarRating;
